import React from 'react';

const Books = props => (
    <div>
         { props.books.map((book) => {
            return (
              <div key={book.primary_isbn13}>
                <img src={book.book_image} alt={book.title} />
                <p>{ book.title }</p>
              </div>
              );
          })
          }
    </div>
);

export default Books;
